    "ecological-monitoring-2014-stationary-point-count-surveys-of-reef-fishes-and-benthic-habit",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes a subset of the
    reef fish and benthic survey data collected by the NOAA Pacific islands Fisheries
    Science Center Coral Reef Ecosystem Division for the Pacific Resource Assessment
    and Monitoring Program and for compatible Papahanaumokuakea Marine National Monument
    (PMNM), National Marine Fisheries Service (NMFS) and Coral Reef Conservation Program
    (CRCP) survey missions in 2014. During that time period, surveys were conducted
    in the Pacific Remote Island Areas, the Mariana Archipelago, and the Northwestern
    Hawaiian Islands. The status of reefs in each region is first described in the wider
    U.S. Pacific context and then at the island scale for each of the regions. Data
    on fish biomass (total; by size class; by consumer group) and benthic cover (hard
    coral; macroalgae; encrusting algae; turf algae) are presented at the island level,
     as well as maps showing survey sites.",nt"license_title": "License Not Specified",nt"extras":
